import React from "react";
import ItemList from "./ItemList";



const Item = ({prods}) => {
 
  return (
    <div className="card cardStyle bg-dark" style={{width:"18rem"}}>
       <div className="card-body text-white">
     <h1>{prods.Nombre}</h1>
     <h1>{prods.Descripcion}</h1>
     </div>
    </div>
  );
}; 

export default Item;
